window.bookSummaryJSON = "<p>This debut science fiction novel is the story of Sira - a woman on the run from the law, from her own people, and from an unknown figure determined to use her for his own ends. Her memory taken from her by a stasis block, she must stay free long enough to regain both her identity and the full use of her telepathic powers. The price of failure may not only be the loss of her own future, but that of her entire race.</p>"; 
